{'pk': 18084645622193006, 'user_id': 1437896982, 'text': 'El próximo 23 de enero vuelve el fenómeno escandinavo: Lena Andersson y la afilada secuela de «Apropiación indebida». Leer este libro es como ver un accidente a cámara lenta. La relación entre Ester Nilsson y el actor Olof Sten tiene una forma desigual: el ciego enamoramiento de ella, el deleite narcisista de él. Y aunque desde el principio Olof le deja claro que no se plantea abandonar a su mujer, ni él frena las muestras de amor de Ester, ni ella asume la imposibilidad de este amor. A los encuentros les suceden las llamadas, a las llamadas los malentendidos, a estos las discusiones y, de nuevo, los castillos en el aire de la protagonista. Andersson trata con humor, rigor y una fina crueldad las esperanzas sin fundamento de Ester y las mentiras sobre las que en ocasiones se construyen nuestras relaciones. mentiras a los demás pero, sobre todo, mentiras a nosotros mismos. «Andersson\xa0saca a la luz la crueldad y el humor de cualquier obsesión romántica [...]. Fascinante.»
The New\xa0Yorker

