{'pk': 17903720473403326, 'user_id': 1437896982, 'text': '«Un\xa0thriller\xa0impactante. Toda una revelación» Carmen Mola

Despedimos el año con un adelanto de lo que será 2020 para Alfaguara Negra, «Progenie», de @susanamartingijon. Sevilla, ola de calor. Todo el que puede huye a la playa. No así Camino Vargas, jefa accidental del Grupo de Homicidios desde el tiroteo que dejó en coma al inspector Arenas. Alguien ha atropellado salvajemente a una mujer y se ha dado a la fuga. Este asesinato se va a transformar en el foco de atención mediática cuando se filtre un dato aún más perturbador: el homicida introdujo un chupete en la boca de la víctima antes de desaparecer de la escena del crimen. Todos los indicios apuntan a la expareja, un maltratador psicológico, y las estadísticas no están de su lado. Sin embargo, cuando la autopsia desvele que la víctima estaba embarazada y los asesinatos comiencen a sucederse, Camino comprenderá que se halla ante el caso más duro de su carrera.

