{'pk': 17857311667678710, 'user_id': 1437896982, 'text': '¿Cuánto de Juan José Millás hay en Juan José Millás? Vuelve el ingenio de Millás con el diario divertido y surrealista de un neurótico brillante. «Millás se aprovecha de la actualidad para contarnos la vida, para expresar su perplejidad, que es la nuestra, ante el discurrir del mundo. […] Navegar por él permite viajar a nuestra imaginación.»
Fernando Delgado, La Opinión «En todo ello está esa capacidad de Millás para ver donde otros no alcanzamos ni siquiera a vislumbrar nada.» César Coca, El Correo «Lo que en realidad hace Juan José Millás en La vida a ratos, lejos de escribir un diario convencional, es inventar un género - el "diarismo fantástico" [...]. Aquí está el mejor Millás, el autor en estado puro, liberado de la tiranía del género y del convencionalismo de tener que idear un personaje, urdir un argumento y atarse mínimamente a unas reglas cuyo dominio está sobradamente probado.» Iñaki Ezquerra, El Correo Español «Es maravilloso. Es un diario libérrimo. Regala momentos memorables.» Pepa Fernández, «No es un día cualquiera» (Radio Nacional)

