{'pk': 17843139109842773, 'user_id': 1437896982, 'text': 'Hoy hablamos de Peter Handke (Griffen, 6 de diciembre de 1942) escritor austríaco, ganador del Premio Nobel de Literatura (2019). Poeta, dramaturgo y novelista, la obra de Handke gira alrededor de la soledad y la falta de comunicación, con personajes angustiados y fuera de la sociedad, inmersos en problemas existenciales. Su producción literaria es muy extensa.

En nuestro catálogo puedes disfrutar de «El miedo del portero al penalti», «El momento de la sensación verdadera», «El juego de las preguntas», «El chino del dolor» y «La tarde de un escritor». ¿Has leído ya la obra de Handke? ¿Cuál recomendarías a quien se quiera iniciar?

