{'pk': 17844045898824211, 'user_id': 1437896982, 'text': 'Cuando la CIA pone los intereses de la United Fruit Company por encima de los de un pueblo llegan ‘Tiempos recios’, la última novela de Mario Vargas Llosa. ¿Ya lo has leído? Etiquétanos y compartiremos tu reseña en nuestras stories. «Vargas Llosa vuelve a hacer, en Tiempos recios, un retrato histórico de un episodio clave y bastante desconocido en la historia latinoamericana. Con al menos dos personajes fascinantes: Abbes García y Martita. De Premio Nobel.»
Luisgé Martín

