{'pk': 17849056357732771, 'user_id': 1437896982, 'text': '«Una novela maravillosa, fantástica. Una lección sobre la pérdida del miedo. Me ha encantado. Contiene enormes lecciones sobre el miedo, la tristeza, la angustia, también habla sobre la maternidad, la medicina y nosotros.»
@bobpop, A Vivir Madrid (Cadena Ser)

Que la vida va en serio Gina lo descubre de golpe y sin previo aviso: la adolescencia todavía está cerca y la edad adulta, con todos sus compromisos, parece lejana, pero una mañana se despierta con una sensación rara en el cuerpo y, tras meses de pruebas, le cae encima un diagnóstico médico tan grave como inesperado.

Este es el punto de partida de Gina, una novela llena de encanto, tierna y divertida, que narra en primera persona las tribulaciones de esta treintañera poco convencional que nos cuenta su vida como si nos susurrara un secreto apasionante al oído.

