{'pk': 17887634980371534, 'user_id': 1437896982, 'text': "Como un mismo tema musical (el del #erotismo, los recuerdos y el cuerpo) tocado en sus diversas variaciones, así son los vínculos de Paul con las diferentes personas que han ido dando forma a lo que él entiende por #amor. Hombres y mujeres con los que se ha encontrado desde su adolescencia en Italia hasta su madurez en Estados Unidos.

Todas estas conexiones, que trazan una constelación cargada de #deseo a lo largo de la vida de su protagonista, señalan también los momentos culminantes de 'Variaciones Enigma', la nueva y magistral #novela de André Aciman, autor de ‘Llámame por tu nombre’. Un relato #sensual y repleto de destellos sobre la posibilidad de descubrirnos a través de los demás, de nuestros momentos compartidos y de la intimidad construida de manera conjunta.

