{'pk': 17950059205304235, 'user_id': 1437896982, 'text': 'Verdad, progreso, tiempo, identidad, política, realidad, conciencia, bondad... Son palabras que, en su esencia, nos pertenecen a todos y nos unen por encima de cualquier diferencia. Pero estamos asistiendo a una transformación dirigida de sus significados para conseguir que definan realidades mucho más parciales e interesadas, mucho menos universales.

Luis García Montero las recupera aquí, las alisa, les devuelve su sentido original y las rehabilita en su valor integral. La del compromiso cívico es la estirpe a la que, como el Juan de Mairena de Antonio Machado, pertenece este libro en el que brillan las marcas del genio literario del autor: la reflexión, el vitalismo y una prosa que desprende elegancia, calidez, poesía y sensibilidad.

