{'pk': 17987566891244041, 'user_id': 1437896982, 'text': "'Malaherba' de Manuel Jabois es una #historia de dos niños que viven una extraña y solitaria historia de #amor. Un #libro sobre las cosas terribles que se hacen con #cariño, escrito con #humor y una #prosa rápida que avanza llevando a los protagonistas a la frontera de un mundo nuevo.

