{'pk': 17863683037355527, 'user_id': 1437896982, 'text': "Emilia tiene un trabajo que le gusta, un marido ideal, dos hijos encantadores, una casa en las afueras y una cotidianidad con diversiones. La vida normal de una persona que, el día menos pensado, se revela como frágil y quebradiza. Emilia ha suprimido el recuerdo de aquella agresión, hace ya años; para negar la herida y construir una realidad en la que ella no sea una víctima. Pero un momento de pánico hace que el dolor brote de nuevo y tome posesión de su vida. 'La persona normal', de Marijke Schermer, es una #novela sobrecogedora sobre el silencio, la negación y las consecuencias de vivir sin asumir el pasado.

La #autora, una de las más potentes de la #narrativa europea actual, describe una vida ideal pero de un equilibrio tan precario que la sensación de peligro llena cada #página del #libro. Un peligro que puede llegar a paralizar si no se le hace frente.

