{'pk': 17968832467229488, 'user_id': 1437896982, 'text': 'Llega a librerías «Una historia de España» de Arturo Pérez-Reverte. Un relato ácido, divertido, personal y poco ortodoxo de nuestra historia.

A lo largo de los 91 capítulos más el epílogo de los que consta el libro, Arturo Pérez-Reverte narra los principales acontecimientos ocurridos desde los orígenes de nuestra historia y hasta el final de la Transición con una mirada subjetiva, construida con las dosis exactas de lecturas, experiencia y sentido común. «La misma mirada con que escribo novelas y artículos -dice el autor-; no la elegí yo, sino que es resultado de todas esas cosas: la visión, ácida más a menudo que dulce, de quien, como dice un personaje de una de mis novelas, sabe que ser lúcido en España aparejó siempre mucha amargura, mucha soledad y mucha desesperanza.» Un relato ameno, personal, a ratos irónico, pero siempre único, de nuestra accidentada historia a través de los siglos. Una obra concebida por el autor para, en palabras suyas, «divertirme, releer y disfrutar; un pretexto para mirar atrás desde los tiempos remotos hasta el presente, reflexionar un poco sobre ello y contarlo por escrito de una manera poco ortodoxa.» Sin conocer lo que fuimos nunca comprenderemos lo que somos.

