{'pk': 17917176586144509, 'user_id': 1437896982, 'text': 'Después de La lengua de las mariposas, Manuel Rivas retoma el hilo de la tragedia española, la guerra que estremeció al mundo y marcó la historia del siglo XX. Pero El lápiz del carpintero no es una historia más sobre la guerra. Trata de la vida de los hombres y las mujeres en el lado más salvaje de la historia. Trata de la fuerza del amor ocupando el hueco abismal de la desesperanza.

Con el lápiz del carpintero, con las manos de las lavanderas, con el dolor fantasma de los amputados, con la belleza tísica de los enfermos... va tejiéndose la red de la realidad inteligente. Aquí el lenguaje se confunde con el aliento de la vida, con el código morse de las vísceras. Una novela escrita desde hoy y para siempre.

