{'pk': 17929546726098161, 'user_id': 1437896982, 'text': '«Uno viene de una familia como de una tierra lejana. La nuestra era un caso aparte, con sus propias costumbres y crueldades.» Para los habitantes de Cape Cod, madre es un ejemplo de piedad, austeridad y trabajo duro. Para su marido y sus siete hijos, es egoísta, a veces mezquina, siempre tirana y disfruta enfrentándolos entre sí. Angela, su favorita que murió en el parto, es la única capaz de entenderla, según dice a los demás. Entre estos se incluyen Fred, un abogado de oficio; Floyd, un divertido profesor; un par de inseparables hermanas cuya devoción por la figura materna ha consumido sus vidas, y JP, el narrador, un escritor de éxito cuyo trabajo menosprecia.

Tierra madre -la esperada gran novela de Paul Theroux, fruto de años de reflexión literaria y afectiva- es un punzante retrato del impacto que el narcisismo materno puede tener en una familia, un cautivador, doloroso y a menudo divertido relato sobre una gran familia que discute, conspira, se confabula y finalmente vence los dolorosos lazos que la unen.

