{'pk': 17929437106078609, 'user_id': 1437896982, 'text': '«La doctrina liberal ha representado desde sus orígenes las formas más avanzadas de la cultura democrática y lo que más nos ha ido defendiendo de la inextinguible "llamada de la tribu". Este #libro quisiera contribuir con un granito de arena a esa indispensable tarea.» La diferencia entre La llamada de la tribu y otros libros como El pez en el agua es que aquí el protagonismo no lo tienen las vivencias del autor, sino las #lecturas que moldearon su forma de pensar y de ver el mundo en los últimos cincuenta años. 
Mario Vargas Llosa ha hecho una cartografía de los siete pensadores liberales {Adam Smith, José Ortega y Gasset, Friedrich Hayek, Karl Popper, Raymond Aron, Isaiah Berlin, Jean-François Revel} que le ayudaron a desarrollar un nuevo cuerpo de ideas después del gran trauma ideológico que supuso, por un lado, el desencanto con la Revolución Cubana y, por otro, el distanciamiento de las ideas de Jean-Paul Sartre, el autor que más lo había inspirado en su juventud.

