{'pk': 17924665675008227, 'user_id': 1437896982, 'text': 'Los seres humanos, sostiene este #libro, no hemos inventado la novela: es la novela la que nos ha inventado a nosotros. Pero ¿qué nos dan las novelas que no nos puede dar ninguna otra forma narrativa? ¿Qué lugar ocupan en nuestras vidas como individuos y como sociedades? ¿Por qué son, según Vásquez, una manera irremplazable de investigarnos a nosotros mismos, y cómo llevan a cabo sus sortilegios?

De Cervantes a Conrad, de Tolstoi a Vargas Llosa, de Proust a Camus, estos #ensayos proponen un elogio de ese género proteico y también, entre líneas, un lamento por su situación presente en un mundo que se le ha vuelto hostil.

