{'pk': 17883028873171408, 'user_id': 1437896982, 'text': '«Toda mi vida había oído un silbido procedente del bosque de abedules flameados. Y una noche de 1991, ese silbido creció hasta formar un viento que hizo que me tambaleara.» Tras éxito de "El libro de la madera" llega "Los dieciséis árboles del Somme" la gran obra de Lars Mytting, estrella de la literatura noruega junto a Knausgård.

Una historia épica sobre el amor y la pérdida que recorre las vidas de tres generaciones de una familia. Un apasionante viaje por el pasado de Europa pero también por los árboles y la naturaleza.

