{'pk': 17898663532098526, 'user_id': 1437896982, 'text': 'Desde 2007, en su colección Historias de la Clínica, la Clínica Universidad de Navarra presenta cada año un nuevo relato sobre el caso médico de un paciente narrado por un escritor de prestigio. El talento de los escritores que las firman convierte cada historia, siempre emotiva, en una gran narración literaria. En el décimo aniversario de la colección, Alfaguara reúne los diez #relatos en un único volumen para #leer, #releer y atesorar.

Vivir a pulso celebra la fuerza que, sin saber muy bien cómo, nos sostiene y nos impulsa, que nos arroja contra viento y marea a través de los obstáculos que otros consideran insalvables. Estos relatos cuentan, en la pluma de grandes #escritores de nuestro tiempo, las conmovedoras historias de vida de personas que, a pesar de las enfermedades que padecen, convierten sus experiencias en inspiradores ejemplos de superación.

Los 10 autores de esta edición son: 🖋Luis Mateo Díez 🖋 Bernardo Atxaga 🖋 Marta Rivera de la Cruz 🖋 Fernando Aramburu 🖋 Lorenzo Silva 🖋 Mercedes Salisachs 🖋 José María Merino 🖋 Gustavo Martín Garzo 🖋 Soledad Puértolas 🖋 Juan Manuel de Prada. ______________________________ _________________ 👉🏻Todos los beneficios que se obtengan de la venta de este #libro se destinarán a Niños contra el Cáncer, una iniciativa de la Clínica Universidad de Navarra para promover la investigación en cáncer infantil y ayudar a las familias en el diagnóstico y tratamiento de la enfermedad.👈🏻 #vivirapulso #megustaleer #editorialalfaguara #libros #librosolidario #bookstagram #booklovers  #books  #leeresvivir  #amoleer #📚', 'type': 1, 'created_at': 1512304680, 'created_at_utc': 1512304680, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 1437896982, 'username': 'alfaguaraes', 'full_name': 'Editorial Alfaguara', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/12816977_537497229745080_702682546_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=NeWEWL7IuCgAX9pqaUr&oh=c95191c77b0d5de4f490a67b0d4406db&oe=5FD0F97E', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 1604822918, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 1661653422074326217, 'private_reply_status': 0}

