{'pk': 17882406427022862, 'user_id': 1437896982, 'text': 'En unos tiempos convulsos para la profesión, la voz de Juan Cruz Ruiz [Premio de Honor de la Asociación de la Prensa de Madrid] se alza potente en UN GOLPE DE VIDA, relato autobiográfico sobre su labor como periodista. Un #libro en el que la vida y el oficio se cruzan una y otra vez a lo largo de los años para formar una única realidad que va siendo desgranada por el autor, capítulo a capítulo, con la sensibilidad y la pasión que caracterizan todas sus obras. «Mis sueños tienen muchas veces el nombre del periodismo; este oficio va en mis pies, ocupa mi cerebro, conduce mis sensaciones, no soy de otra materia. Si duermo me despierta el periodismo, y si decaigo el periodismo me pone otra vez a trabajar; el periodismo es la alegría y también un suspiro mortal, una despedida. El oficio invencible. Para mí también el oficio inevitable.» Juan Cruz Ruiz

