{'pk': 17855314168172816, 'user_id': 1437896982, 'text': 'Tras el éxito internacional de No está solo, vuelve la inolvidable pareja de investigadores formada por Colomba Caselli y Dante Torre en EL ÁNGEL, un electrizante thriller de aterradora actualidad.

La muerte llega a Roma a las doce menos diez minutos de la noche con un tren de alta velocidad procedente de Milán. Del coche de lujo extrañamente no sale nadie. Todos los pasajeros están muertos.

