{'pk': 17879494348001473, 'user_id': 1437896982, 'text': 'Vuelve el mediterráneo. Manuel Vicent regresa en LA REGATA a su territorio más querido. La ciudad de Circea, ya inmortalizada por el autor en Son de Mar, es el escenario en el que transcurre la historia. Pero casi nada queda del territorio ideal que fue esa Ítaca recreada en la novela ganadora del Premio Alfaguara en 1998. El dinero fácil, la corrupción, la importancia de las apariencias, los negocios conseguidos con malas artes, las relaciones superficiales y los intereses espurios han ido transformando el paisaje y a las personas. Del Mediterráneo bello e indomable, sensual y brillante, solo parecen quedar algún destello aislado y los recuerdos atesorados en la memoria de los que lo conocieron.

La elegante sutileza y el extraordinario manejo de la ironía que caracterizan al autor recorren cada página de esta historia sobre el paraíso que un día todos decidimos perder.

