{'pk': 17851719967162015, 'user_id': 1437896982, 'text': 'Celebramos el Día Internacional de los Bosques leyendo EL LIBRO DE LA MADERA, un #libro único, sorprendente éxito de ventas y fenómeno mundial, ganador del British Book Industry Award al Mejor Libro de No Ficción del Año.

