{'pk': 17843097142188070, 'user_id': 1437896982, 'text': 'CONCURSO INTERNACIONAL

Los estupendos escritores Jordi Llobregat, autor de «El secreto de Vesalio», y Santiago Álvarez, creador de «La ciudad de la Memoria» y próximamente de «El jardín de cartón», idearon estos magníficos homenajes a la cubierta de «La carne». Nos sumamos y os proponemos que hagáis vuestro propio homenaje a la cubierta de la gran novela de Rosa Montero, utilizando #lacarnerosa y haciendo una sencilla fotografía con características similares en la que mostréis vuestra carne visible: el cuello, su piel, lo que os hace humanos, sin edad, deseosos y deseantes. 
Los ganadores obtendrán un ejemplar firmado por la autora. El concurso estará activo desde hoy hasta el 30 de octubre. Como dice Rosa Montero: «¡Sacad a la fiera!». Bases legales en la secciones de notas de nuestra fanpage.', 'type': 1, 'created_at': 1476112167, 'created_at_utc': 1476112167, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 1437896982, 'username': 'alfaguaraes', 'full_name': 'Editorial Alfaguara', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/12816977_537497229745080_702682546_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=NeWEWL7IuCgAX9pqaUr&oh=c95191c77b0d5de4f490a67b0d4406db&oe=5FD0F97E', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 1604822918, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 1358037688942354245, 'private_reply_status': 0}
